import React, { Component } from 'react' 


class AddProduct extends Component {

    render() {
        return(
            <div class="product-form-container">
                <ul class='mini-nav-list'>
                    <li> + ADD PRODUCT </li>
                    <li> + ADD MATERIAL </li>
                </ul>
            </div>
        );
    }
}

export default AddProduct
